export class Projects extends Component {
  render() {
    return (
      <div className = "component">
        <div className = "container">
          <h1>Projects</h1><p>NOT A LOT HERE. LET'S MAKE SOMETHING TOGETHER</p><hr/>
        </div>
      </div>
    )
  }
}

export default Projects
